/*Compute P = rhoRT/W(x) */
void CKPX(double * restrict rho, double * restrict T, double * restrict x, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double XW = 0;/* To hold mean molecular wt */
    XW += x[0]*170.341020; /*NC12H26 */
    XW += x[1]*1.007970; /*H */
    XW += x[2]*15.999400; /*O */
    XW += x[3]*17.007370; /*OH */
    XW += x[4]*33.006770; /*HO2 */
    XW += x[5]*2.015940; /*H2 */
    XW += x[6]*18.015340; /*H2O */
    XW += x[7]*34.014740; /*H2O2 */
    XW += x[8]*31.998800; /*O2 */
    XW += x[9]*14.027090; /*CH2 */
    XW += x[10]*14.027090; /*CH2* */
    XW += x[11]*15.035060; /*CH3 */
    XW += x[12]*16.043030; /*CH4 */
    XW += x[13]*29.018520; /*HCO */
    XW += x[14]*30.026490; /*CH2O */
    XW += x[15]*31.034460; /*CH3O */
    XW += x[16]*28.010550; /*CO */
    XW += x[17]*44.009950; /*CO2 */
    XW += x[18]*26.038240; /*C2H2 */
    XW += x[19]*27.046210; /*C2H3 */
    XW += x[20]*28.054180; /*C2H4 */
    XW += x[21]*29.062150; /*C2H5 */
    XW += x[22]*30.070120; /*C2H6 */
    XW += x[23]*43.045610; /*CH2CHO */
    XW += x[24]*41.073300; /*aC3H5 */
    XW += x[25]*42.081270; /*C3H6 */
    XW += x[26]*43.089240; /*nC3H7 */
    XW += x[27]*56.064730; /*C2H3CHO */
    XW += x[28]*55.100390; /*C4H7 */
    XW += x[29]*56.108360; /*C4H81 */
    XW += x[30]*57.116330; /*pC4H9 */
    XW += x[31]*69.127480; /*C5H9 */
    XW += x[32]*70.135450; /*C5H10 */
    XW += x[33]*71.143420; /*PXC5H11 */
    XW += x[34]*84.162540; /*C6H12 */
    XW += x[35]*85.170510; /*PXC6H13 */
    XW += x[36]*98.189630; /*C7H14 */
    XW += x[37]*99.197600; /*PXC7H15 */
    XW += x[38]*112.216720; /*C8H16 */
    XW += x[39]*113.224690; /*PXC8H17 */
    XW += x[40]*126.243810; /*C9H18 */
    XW += x[41]*127.251780; /*PXC9H19 */
    XW += x[42]*140.270900; /*C10H20 */
    XW += x[43]*141.278870; /*PXC10H21 */
    XW += x[44]*169.333050; /*PXC12H25 */
    XW += x[45]*169.333050; /*SXC12H25 */
    XW += x[46]*169.333050; /*S3XC12H25 */
    XW += x[47]*168.325080; /*C12H24 */
    XW += x[48]*201.331850; /*C12H25O2 */
    XW += x[49]*201.331850; /*C12OOH */
    XW += x[50]*233.330650; /*O2C12H24OOH */
    XW += x[51]*216.323280; /*OC12H23OOH */
    XW += x[52]*28.013400; /*N2 */
    *P = *rho * 8.31451e+07 * (*T) / XW; /*P = rho*R*T/W */

    return;
}


/*Compute P = rhoRT/W(y) */
void CKPY(double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW = 0;/* for computing mean MW */
    YOW += y[0]*imw[0]; /*NC12H26 */
    YOW += y[1]*imw[1]; /*H */
    YOW += y[2]*imw[2]; /*O */
    YOW += y[3]*imw[3]; /*OH */
    YOW += y[4]*imw[4]; /*HO2 */
    YOW += y[5]*imw[5]; /*H2 */
    YOW += y[6]*imw[6]; /*H2O */
    YOW += y[7]*imw[7]; /*H2O2 */
    YOW += y[8]*imw[8]; /*O2 */
    YOW += y[9]*imw[9]; /*CH2 */
    YOW += y[10]*imw[10]; /*CH2* */
    YOW += y[11]*imw[11]; /*CH3 */
    YOW += y[12]*imw[12]; /*CH4 */
    YOW += y[13]*imw[13]; /*HCO */
    YOW += y[14]*imw[14]; /*CH2O */
    YOW += y[15]*imw[15]; /*CH3O */
    YOW += y[16]*imw[16]; /*CO */
    YOW += y[17]*imw[17]; /*CO2 */
    YOW += y[18]*imw[18]; /*C2H2 */
    YOW += y[19]*imw[19]; /*C2H3 */
    YOW += y[20]*imw[20]; /*C2H4 */
    YOW += y[21]*imw[21]; /*C2H5 */
    YOW += y[22]*imw[22]; /*C2H6 */
    YOW += y[23]*imw[23]; /*CH2CHO */
    YOW += y[24]*imw[24]; /*aC3H5 */
    YOW += y[25]*imw[25]; /*C3H6 */
    YOW += y[26]*imw[26]; /*nC3H7 */
    YOW += y[27]*imw[27]; /*C2H3CHO */
    YOW += y[28]*imw[28]; /*C4H7 */
    YOW += y[29]*imw[29]; /*C4H81 */
    YOW += y[30]*imw[30]; /*pC4H9 */
    YOW += y[31]*imw[31]; /*C5H9 */
    YOW += y[32]*imw[32]; /*C5H10 */
    YOW += y[33]*imw[33]; /*PXC5H11 */
    YOW += y[34]*imw[34]; /*C6H12 */
    YOW += y[35]*imw[35]; /*PXC6H13 */
    YOW += y[36]*imw[36]; /*C7H14 */
    YOW += y[37]*imw[37]; /*PXC7H15 */
    YOW += y[38]*imw[38]; /*C8H16 */
    YOW += y[39]*imw[39]; /*PXC8H17 */
    YOW += y[40]*imw[40]; /*C9H18 */
    YOW += y[41]*imw[41]; /*PXC9H19 */
    YOW += y[42]*imw[42]; /*C10H20 */
    YOW += y[43]*imw[43]; /*PXC10H21 */
    YOW += y[44]*imw[44]; /*PXC12H25 */
    YOW += y[45]*imw[45]; /*SXC12H25 */
    YOW += y[46]*imw[46]; /*S3XC12H25 */
    YOW += y[47]*imw[47]; /*C12H24 */
    YOW += y[48]*imw[48]; /*C12H25O2 */
    YOW += y[49]*imw[49]; /*C12OOH */
    YOW += y[50]*imw[50]; /*O2C12H24OOH */
    YOW += y[51]*imw[51]; /*OC12H23OOH */
    YOW += y[52]*imw[52]; /*N2 */
    *P = *rho * 8.31451e+07 * (*T) * YOW; /*P = rho*R*T/W */

    return;
}


/*Compute P = rhoRT/W(y) */
void VCKPY(int * restrict np, double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW[*np];
    for (int i=0; i<(*np); i++) {
        YOW[i] = 0.0;
    }

    for (int n=0; n<53; n++) {
        for (int i=0; i<(*np); i++) {
            YOW[i] += y[n*(*np)+i] * imw[n];
        }
    }

    for (int i=0; i<(*np); i++) {
        P[i] = rho[i] * 8.31451e+07 * T[i] * YOW[i]; /*P = rho*R*T/W */
    }

    return;
}


/*Compute P = rhoRT/W(c) */
void CKPC(double * restrict rho, double * restrict T, double * restrict c, int * iwrk, double * restrict rwrk, double * restrict P)
{
    int id; /*loop counter */
    /*See Eq 5 in CK Manual */
    double W = 0;
    double sumC = 0;
    W += c[0]*170.341020; /*NC12H26 */
    W += c[1]*1.007970; /*H */
    W += c[2]*15.999400; /*O */
    W += c[3]*17.007370; /*OH */
    W += c[4]*33.006770; /*HO2 */
    W += c[5]*2.015940; /*H2 */
    W += c[6]*18.015340; /*H2O */
    W += c[7]*34.014740; /*H2O2 */
    W += c[8]*31.998800; /*O2 */
    W += c[9]*14.027090; /*CH2 */
    W += c[10]*14.027090; /*CH2* */
    W += c[11]*15.035060; /*CH3 */
    W += c[12]*16.043030; /*CH4 */
    W += c[13]*29.018520; /*HCO */
    W += c[14]*30.026490; /*CH2O */
    W += c[15]*31.034460; /*CH3O */
    W += c[16]*28.010550; /*CO */
    W += c[17]*44.009950; /*CO2 */
    W += c[18]*26.038240; /*C2H2 */
    W += c[19]*27.046210; /*C2H3 */
    W += c[20]*28.054180; /*C2H4 */
    W += c[21]*29.062150; /*C2H5 */
    W += c[22]*30.070120; /*C2H6 */
    W += c[23]*43.045610; /*CH2CHO */
    W += c[24]*41.073300; /*aC3H5 */
    W += c[25]*42.081270; /*C3H6 */
    W += c[26]*43.089240; /*nC3H7 */
    W += c[27]*56.064730; /*C2H3CHO */
    W += c[28]*55.100390; /*C4H7 */
    W += c[29]*56.108360; /*C4H81 */
    W += c[30]*57.116330; /*pC4H9 */
    W += c[31]*69.127480; /*C5H9 */
    W += c[32]*70.135450; /*C5H10 */
    W += c[33]*71.143420; /*PXC5H11 */
    W += c[34]*84.162540; /*C6H12 */
    W += c[35]*85.170510; /*PXC6H13 */
    W += c[36]*98.189630; /*C7H14 */
    W += c[37]*99.197600; /*PXC7H15 */
    W += c[38]*112.216720; /*C8H16 */
    W += c[39]*113.224690; /*PXC8H17 */
    W += c[40]*126.243810; /*C9H18 */
    W += c[41]*127.251780; /*PXC9H19 */
    W += c[42]*140.270900; /*C10H20 */
    W += c[43]*141.278870; /*PXC10H21 */
    W += c[44]*169.333050; /*PXC12H25 */
    W += c[45]*169.333050; /*SXC12H25 */
    W += c[46]*169.333050; /*S3XC12H25 */
    W += c[47]*168.325080; /*C12H24 */
    W += c[48]*201.331850; /*C12H25O2 */
    W += c[49]*201.331850; /*C12OOH */
    W += c[50]*233.330650; /*O2C12H24OOH */
    W += c[51]*216.323280; /*OC12H23OOH */
    W += c[52]*28.013400; /*N2 */

    for (id = 0; id < 53; ++id) {
        sumC += c[id];
    }
    *P = *rho * 8.31451e+07 * (*T) * sumC / W; /*P = rho*R*T/W */

    return;
}


